    const linkStyle = {

        color: 'white'
      };
    return(<div className="divFooter">
        <ul className="footer row">
            <li className="col-4 text-center"><Link to="/Personajes" style={linkStyle}>Personajes</Link></li>
            <li className="col-4 text-center"><Link to="/Casas">Casas</Link></li>
            <li className="col-4 text-center"><Link to="/Cronologia">Cronologia</Link></li>

        </ul>
    </div>
        
    )
}
